INF  = math.inf

class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m = len(board)
        pos=[None]*m 
        p = [[-INF,-1]]*3
        def update(row):
            for i,x in enumerate(row):
                if x> p[0][0]:
                    if p[0][1] != i :
                        if p[1][1] != i:
                            p[2] = p[1]
                        p[1]=p[0]
                    p[0] = [x,i]
                elif x > p[1][0] and i != p[0][1]:
                    if p[1][1] != i:
                        p[2]= p[1]
                    p[1] = [x,i]
                elif x > p[2][0] and i !=p[0][1] and i != p[1][1]:
                    p[2] = [x,i]
        for i in range(m-1,-1,-1):
            update(board[i])
            #print(i)
            pos[i] = list(p)
        #print(pos)
        ans = -INF
        p = [[-INF,-1]]*3
        for i, row in enumerate(board[:-2]):
            update(row)
            for j2,y in enumerate(board[i+1]):
                for x,j1 in p:
                    for z,j3 in pos[i+2]:
                        #print(i+2,pos[i+2])
                        if j1 != j2 and j1!=j3 and j2 != j3:
                            ans = max(ans, x+y+z)
        return ans




